vector<int> t = {6, 2, 5, 4, 7, 6, 3, 5, 7, 6, 9, 11, 0};
vector<int> timeline;
vector<int> tr(13);
vector<int> used;

int dfs(int v){
    if (used[v] != -1){
        return used[v];
    }

    int start = 0;
    for (int i = 0; i < g[v].size(); i++){
        start = max(dfs(g[v][i]-1), start);
    }
    start += tr[v];
    int end = start + t[v];

    for (int i = start; i < end; i++) timeline[i]++;

    used[v] = end;
    return end;
}

int longest_p(){
    int c = 0;
    int max_c = 0;
    for (int i = 0; i < timeline.size(); i++){
        if (timeline[i] == 4) c++;
        else c = 0;
        max_c = max(c, max_c);
    }
    return max_c;
}

void solve(){
    int max_p = 0;
    vector<int> mtr(13);

    while (tr[13-1] != 1){
        timeline.assign(30, 0);
        used.assign(13, -1);
        dfs(13-1);
        int p = longest_p();
        if (p >= max_p){
            max_p = p;
            mtr = tr;
        }

        int j = 0;
        while(true){
            tr[j]++;
            if (tr[j] == 6){
                tr[j] = 0;
                j++;
            }
            else{
                break;
            }
        }
    }

    cout << max_p << endl;
}
