struct node {
    int max_len = 0;
    int max_pref_len = 0;
    int max_suf_len = 0;
    int len = 1;
};

vector<node> t;

node merge(node& n1, node& n2) {
    node n;
    n.len = n1.len + n2.len;
    if (n1.len == n1.max_len) {
        n.max_pref_len = n1.len + n2.max_pref_len;
    } else {
        n.max_pref_len = n1.max_pref_len;
    }
    if (n2.len == n2.max_len) {
        n.max_suf_len = n2.len + n1.max_suf_len;
    } else {
        n.max_suf_len = n2.max_suf_len;
    }
    n.max_len = max(max(n1.max_len, n2.max_len), n1.max_suf_len + n2.max_pref_len);
    return n;
}

void update(int v, int vl, int vr, int ind) {
    if (vl == vr) {
        t[v].max_len = t[v].max_pref_len = t[v].max_suf_len = 1;
        return;
    }
    int vm = (vl + vr) / 2;
    if (ind <= vm) {
        update(2 * v, vl, vm, ind);
    } else {
        update(2 * v + 1, vm + 1, vr, ind);
    }
    t[v] = merge(t[2 * v], t[2 * v + 1]);
}

