      timeout.current = setTimeout(() => {
        stopRecording()
      }, MAX_RECORDING_TIME)
    }
  }, [checkForPermissionsAndCreateStream, stopRecording])

  return {
    audioUrl,
    audioFile,
    duration,
    isRecording,
    startRecording,
    stopRecording,
    setDuration,
  }
}

